with open("*luban_posdata_path",'r') as fh:
     lines = fh.readlines()
datas=[]
for line in lines:
    items = line.strip().split("POSModifyHandler :")
    try:
        data = json.loads(items[-1])
        datas.append(data)
    except Exception as e:
        print(e)
thread_list = []
print(len(datas))
for i in range(30):
    # ds = datas[i*1000:(i+1)*1000]
    t = threading.Thread(target=post_url,args=(datas[i],i))
    t.start()
    thread_list.append(t)
start = time.time()
for i in thread_list:
    i.join()
print("total_cost_time:{}".format(time.time() - start))

